comment:
하늘아 어지간히나대 너같은 팬은 방탄오빠들이고 워너원오빠들이고 필요없어 너는 다른남돌을 욕하는게
너의최애돌한테 잘해주고싶어서겠지만 방탄오빠들하고워너원오빠들은 너같은 팬들이있어야 더욕먹고
슬퍼져 너같은팬들은 줘도안가져 어지간히나대라;;

정말기대했는데... 저 심사 ×끼 때문이 잡치네;; 
그린이한테 안감은 머리댄 금발도 ×같고 
우연이 그냥가출해서 기정이랑 결혼해서 행복하게 살았으면 좋겠음;; 일주일 기다렸는데 너무 마음이 아프고 ×같은 얘기만 나왔네..... 저심사×끼 장난아니고 죽이고 싶은대 작가님 저좀 웹툰에 넣어주세요..

악마의 편집 개지리네;;
우돌이 무슨 일 있는 건가요..
그린아 선오 잡아 어서ㅠㅠㅠㅠㅠ

네이버 웹툰은 징크스가 있음..
노란 머리는 개발암이라는 징크스...
ㄹㅇ 저 노란머리 개싫어;;
